import React from 'react';
import "./Card.css";
import { categories } from "../../helper/Data";

function Card() {
    return(
        <div className="card-container">
            <img src="../components/assets/react.svg" alt=""></img>
            {categories.map((categories) =>{
                return(
                    <div className="cards">
                        <img src={categories.img} alt={categories.name}></img>
                        <div className="name">
                            <h2>{categories.name}</h2>
                        </div>
                        <div className="card-over">
                            <p>{categories.options}</p>
                        </div>
                    </div>
                )
            })}
        </div>
    )
}

export default Card;
